export const FriendList = ({ friends, avatar, name, isOnline }) => {
  return (
    <ul class="friend-list">
      {friends.map(friend => (
        <li key={friend.id} class="item">
          <span class="status"></span>
          <img class="avatar" src={avatar} alt="User avatar" width="48" />
          <p class="name">{}</p>
        </li>
      ))}
    </ul>
  );
};
